import React from "react";
import Navigation from "../Navigation/Navigation";
import styles from "./Header.module.scss";
import logo from "../../assets/images/logo.svg";

const Header = () => (
  <div>
    <img src={logo} />
    <Navigation />
  </div>
);

export default Header;
